import React, { Component } from 'react';
import Courselist from '../courselist/courselist'
import './App.css';


class App extends Component {
  state = { 
    courses:['Algo', 'OODP']
   }
  render() { 
    return ( 
      <div>
        Hello World
        <Courselist courses={this.state.courses}/>
      </div>
     );
  }
}

export default App;
